(1, 'le-chemin-des-reves', 'https://cdn.helloasso.com/img/photos/croppedimage-fe3bc63af17d4c7cba4f7e3ef1d4d73e.png', 1, 1, 'Association1901Rig', 'Action sociale', 'https://cdn.helloasso.com/img/logos/le chemin des reves-763967b313f7448b9d7d1012366613f9.jpg', 'Le Chemin Des Rêves', 'Nice', '06300', 'Parce que le handicap n\'est pas une différence, ensemble changeons les mentalités !!!', 'https://www.helloasso.com/associations/le-chemin-des-reves', '2024-07-01 16:10:39', '2024-07-02 14:43:16'),
(3, 'tous-en-piste-avec-baptiste', 'https://cdn.helloasso.com/img/photos/croppedimage-373f207f93a94d09b3ecdbe3f1a392aa.jpg', 0, 0, 'Association1901', 'Médico-sociale', 'https://cdn.helloasso.com/img/logos/croppedimage-d732ac6967eb403eb98f8e6c3267835d.png', 'Tous en piste avec Baptiste ', 'Nice', '06000', 'Cette association a été créée pour collecter des fonds afin que, Baptiste, polyhandicapé atteint d\'une mutation génétique rare, puisse bénéficier d\'une prise en charge médicale la plus importante possible (stage de rééducation à l\'étranger, matériel). Il s\'agit aussi de sensibiliser au handicap.', 'https://www.helloasso.com/associations/tous-en-piste-avec-baptiste', '2024-07-01 16:10:39', '2024-07-02 14:43:16'),
(4, 'accompagnement-et-repit-des-aidants', 'https://cdn.helloasso.com/img/photos/croppedimage-84f0b69fb7fc478e831153dd272246cb.png', 1, 0, 'Association1901Rig', 'Action sociale', 'https://cdn.helloasso.com/img/logos/croppedimage-907acf65945d4311925e69b266c12623.png', 'Accompagnement et Répit des Aidants', 'Nice', '06300', 'L’association ARA est dédiée à toutes les personnes qui aident régulièrement un proche fragilisé par la maladie, le handicap, la perte d’autonomie.\nElle accompagne tous les aidants sans distinction d’âge, de pathologie, de type d’aide et de situation, tout au long de la relation d’aide.', 'https://www.helloasso.com/associations/accompagnement-et-repit-des-aidants', '2024-07-01 16:10:39', '2024-07-02 14:43:16'),
(5, 'smile4all', 'https://cdn.helloasso.com/img/photos/croppedimage-e4c98fe252294674a9aae696f317791a.png', 0, 0, 'Association1901', 'Action sociale', 'https://cdn.helloasso.com/img/logos/croppedimage-6c2f4cd9dc8f4a83bee72cc574b8f4d6.png', 'Smile4All', 'Nice', '06200', 'Notre association a pour but d’apporter du bien-être aux personnes isolées de la société tel que les enfants malades, en situation de handicap ou encore les personnes âgées', 'https://www.helloasso.com/associations/smile4all', '2024-07-01 16:10:39', '2024-07-02 14:43:16'),
(6, 'handicap-aventure', 'https://cdn.helloasso.com/img/photos/croppedimage-d98354ecd919419e8b2ab5d68f4c5edd.png', 0, 0, 'Association1901', 'Sports', 'https://cdn.helloasso.com/img/logos/croppedimage-3db31e39ab0e4ea5b2d6f366455b7b43.png', 'Handicap Aventure', 'Nice', '06000', 'Adaptation des sports de montagne et des matériaux de montagne et spéléologie pour le monde du handicap et grand handicap aux fins de l\'accessibilité pour tous. \nAssociation existante depuis le 8 Juin 1990', 'https://www.helloasso.com/associations/handicap-aventure', '2024-07-01 16:10:39', '2024-07-02 14:43:17'),
(7, 'france-alzheimer-alpes-maritimes', 'https://cdn.helloasso.com/img/photos/croppedimage-b2a2e9b87fe24486a105e8441e8ecacb.png', 1, 1, 'Association1901Rig', 'Médico-sociale', 'https://cdn.helloasso.com/img/logos/06_alpes-maritimes.jpg', 'France alzheimer Alpes-Maritimes', 'Nice', '06100', 'L\'association France Alzheimer 06 accompagne, soutient, informe, forme et oriente les personnes en situation de handicap cognitifs ainsi que leurs proches accompagnants dans le département des Alpes-Maritimes. elle crée des dispositifs de répit (accueil de jour, plate forme d\'accompagnement)', 'https://www.helloasso.com/associations/france-alzheimer-alpes-maritimes', '2024-07-01 16:10:39', '2024-07-02 14:43:17'),
(8, 'anices', 'https://cdn.helloasso.com/img/photos/croppedimage-f853afdc37604bf29096ca6dee3e955f.png', 0, 0, 'Association1901', 'Sports', 'https://cdn.helloasso.com/img/logos/croppedimage-34c7c6f249ef48018b690b8a5efc4973.png', 'ANICES', 'Nice', '06100', 'ANICES pour Association Niçoise d\'Initiatives Culturelles Et Sportives est née en 2007 à Nice dans le but d\'offrir aux personnes en situation de handicaps des activités sportives et culturelles !', 'https://www.helloasso.com/associations/anices', '2024-07-01 16:10:39', '2024-07-02 14:43:17'),
(9, 'handssemble', 'https://cdn.helloasso.com/img/photos/croppedimage-35c5daf1edd449e9bef9a8c2ccbb0958.png', 0, 0, 'Association1901', 'Action sociale', 'https://cdn.helloasso.com/img/logos/croppedimage-9c229171b9e7452f9e36511dff5fd3c4.png', 'HandsSemble', 'Nice', '06000', 'Notre association est une association qui a pour projet d’organiser différents évènements visant à sensibiliser différents publics (jeunes et adultes) sur les situations de handicap. \n\n', 'https://www.helloasso.com/associations/handssemble', '2024-07-01 16:10:39', '2024-07-02 14:43:17'),
(10, 'ma-place-a-moi', 'https://cdn.helloasso.com/img/photos/croppedimage-8a2085da92d747e78421ead5f5df86cb.png', 1, 1, 'Association1901Rig', 'Médico-sociale', 'https://cdn.helloasso.com/img/logos/croppedimage-18120aea8c864863b56f6cbf8d076abd.png', 'Ma Place à Moi', 'Nice', '06000', 'Défendre la création d\'un service spécialisé d\'aide à domicile.\nÉcouter, aider, accompagner les parents et leurs proches en situation de handicap. \nPermettre aux parents d\'échanger et aux enfants adolescents et adultes de se rencontrer. \nSensibiliser tout public sur les questions liées au handicap', 'https://www.helloasso.com/associations/ma-place-a-moi', '2024-07-01 16:10:39', '2024-07-02 14:43:17'),
(11, 'comite-departementale-sport-adapte-des-alpes-marit', 'https://cdn.helloasso.com/img/photos/croppedimage-766d5d01eb5f4cbebc1c766e36fb7759.png', 0, 0, 'Association1901', 'Sports', 'https://cdn.helloasso.com/img/logos/croppedimage-e682910179984151881b580e25b78e3f.png', 'Comité Départementale Sport Adapté des Alpes-Maritimes', 'Nice', '06200', 'Coordonne les projets d\'activités physiques adaptées à destination des personnes en situation de handicap mental et/ou atteintes de troubles psychiques.', 'https://www.helloasso.com/associations/comite-departementale-sport-adapte-des-alpes-marit', '2024-07-01 16:10:39', '2024-07-02 14:43:17'),
(12, 'le-cafe-suspendu-a-nice', 'https://cdn.helloasso.com/img/photos/croppedimage-b472389d3bb347db945bcf7eb95942cf.png', 1, 0, 'Association1901Rig', 'Humanitaire - Caritative', 'https://cdn.helloasso.com/img/logos/croppedimage-25127e539e8e4b88839a2f8d9d1e2b67.png', 'Le Café Suspendu à Nice', 'Nice', '06000', 'L\'association Le Café Suspendu à Nice à pour mission de venir en aide aux plus démunis :       \n- Maraude tous les samedis à 18h00 arrêt de tram Gare Thiers : repas, produits d\'hygiène, vêtements...\n- Actions à l\'international auprès des orphelins, personnes handicapées, personnes âgées, familes...\n', 'https://www.helloasso.com/associations/le-cafe-suspendu-a-nice', '2024-07-01 16:10:39', '2024-07-02 14:43:18'),
(13, 'adsea-06', 'https://cdn.helloasso.com/img/photos/39185.jpg', 1, 1, 'Association1901Rig', NULL, 'https://cdn.helloasso.com/img/logos/adsea-06.jpg', 'ADSEA 06', 'Nice', '06200', 'Association HUMANISTE et ENGAGEE, l\'ADSEA 06 oeuvre en faveur des personnes en situation de handicaps mental ou social.', 'https://www.helloasso.com/associations/adsea-06', '2024-07-01 16:10:39', '2024-07-02 14:43:18'),
(14, 'apf-france-handicap-territoire-06-83', 'https://cdn.helloasso.com/img/photos/143751-1950174c75394b29ba50c239f994aa94.png', 1, 0, 'Association1901Rup', 'Défense des droits', 'https://cdn.helloasso.com/img/logos/apf-france-handicap-territoire-06-83-ecbce9d960c74c1db25f4ab1e57d8f4c.png', 'APF France Handicap - Territoire 06/83', 'Nice', '06100', 'APF France handicap : le nom de la lutte pour l\'inclusion des personnes en situation de handicap', 'https://www.helloasso.com/associations/apf-france-handicap-territoire-06-83', '2024-07-01 16:10:39', '2024-07-02 14:43:18'),
(16, 'loisirs-sejours-cote-d-azur', 'https://cdn.helloasso.com/img/photos/croppedimage-d92163339cf94e73b5b493289e47fa8c.png', 0, 0, 'Association1901', 'Autre', 'https://cdn.helloasso.com/img/logos/croppedimage-7483c874e4244d2abc5e68703566ba1f.png', 'Loisirs Séjours Côte d\'Azur', 'Nice', '06300', 'Association qui œuvre depuis plus de 30 ans et a pour vocation d’offrir :\n- Des vacances et loisirs pour des personnes en situation de handicap mental\n- Des activités de loisirs pour enfants et jeunes', 'https://www.helloasso.com/associations/loisirs-sejours-cote-d-azur', '2024-07-01 16:10:39', '2024-07-02 14:43:18'),
(18, 'handicap-s-universel-2-0', 'https://cdn.helloasso.com/img/photos/amour-58e42d0b967d415fa9688ef3cafc14b0.png', 0, 0, 'Association1901', 'Professionnelle', 'https://cdn.helloasso.com/img/logos/handicap s universel 2 0-a4abe12144f34d29ac9ca5299f1a1e59.jpg', 'Handicap\'s Universel 2.0', 'Nice', '06200', 'Handicap\'s = Performances ', 'https://www.helloasso.com/associations/handicap-s-universel-2-0', '2024-07-01 16:10:39', '2024-07-02 14:43:18'),
(19, 'xyloscope', 'https://cdn.helloasso.com/img/photos/croppedimage-6675406fa5cf414884118f109fa2d0fb.png', 0, 0, 'Association1901', 'Arts et culture', 'https://cdn.helloasso.com/img/logos/croppedimage-4952a266e47a4290a533ee84b1add803.png', 'Xyloscope', 'Cabestany', '66330', 'L’association qui fait rayonner la culture locale !\n\nDepuis le 18 juin 2012, l’Association XYLOSCOPE se donne pour mission de mettre en valeur les talents et les initiatives culturelles de la région.\n\nPour cela, elle propose des activités variées et enrichissantes.', 'https://www.helloasso.com/associations/xyloscope', '2024-07-01 16:10:39', '2024-07-02 14:43:18');

